B.Mr=new A.ba("                             Welcome to the Arab Technology and Innovation Summit (Technovation), taking place on June 6th and 7th, 2023! This exciting event brings together experts and innovators from across the Arab world to share their knowledge and insights on the latest developments in technology and innovation. With a packed schedule of panel discussions, keynote speeches, and networking opportunities, this summit is sure to be a memorable and rewarding experience for all attendees. Don't miss this chance to be a part of the cutting-edge dialogue and progress taking place in the Arab tech community. \n\nWe hope to see you there!\n\nOn the 6th and 7th of June 2023, Technovation will be hosted in an authentic and sumptuous environment with over 500 Technovation specialists, including Arab World strategists and policymakers, in attendance. The 2023 Technovation summit will take place in the InterContinental Hotel, Amman - Jordan. Technovation brings speakers and panelists of the highest caliber to share their experience and knowledge on emerging and hot topics related to technology and innovation, as well as their applications and use cases. The primary themes are the applications of Artificial Intelligence, Robotics, Big Data Analytics, Augmented/Virtual Reality, Metaverse, 5G and the Internet of Things, Blockchain, Cloud Computing, Cyber Security, and others in a variety of sectors and industries including government and public agencies, banking and financial institutions, telecommunications, healthcare, education, aviation, utilities, manufacturing, and agriculture, among others. \n\nGet ready for an incredible experience!\n\n\n                      ",null,B.aj,null,null,null,null,null)
